import React from "react";
import Navbar from "./Navbar";
import MyButton from "./MyButton";
import Footer from "./Footer";

function App() {
  const handleClick = (msg: string) => {
    alert(msg);
  };

  return (
    <div>
      <Navbar />

      {/* Hero Section with Background Image */}
      <div
        style={{
          padding: "60px",
          textAlign: "center",
          color: "white",
          backgroundImage:"url('data:image/jpeg;base64,')",
          backgroundSize: "cover",
          backgroundPosition: "center",
          minHeight: "90vh",
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <h1 id="home">
          <span style={{ color: "#eb6f0bff" }}>Welcome </span>
          <span style={{ color: "white" }}>To My Website</span>
        </h1>

        <p>
          This is my about section with styled text. This is a modern
          multi-section website built step by step using
          <strong> React + TypeScript</strong> in VS Code.
        </p>

        {/* Buttons */}
        <div style={{ marginTop: "20px" }}>
          <MyButton
            title="Say Hello"
            onClick={() => handleClick("Hello from React!")}
          />
          <MyButton title="Disabled Button" disabled={true} />
        </div>
      </div>

      {/* About Section */}
      <section
        id="about"
        style={{ margin: "60px auto", maxWidth: "800px", padding: "20px" }}
      >
        <h2>About</h2>
        <p>
          This website was built step by step using React and TypeScript. It
          demonstrates how you can create modular components, reusable buttons,
          and structured layouts.
        </p>
        <p>
          React allows developers to create interactive UIs, while TypeScript
          provides type-safety and better tooling support. Together, they make
          frontend development powerful and reliable.
        </p>
      </section>

      {/* Services Section */}
      <section
        id="services"
        style={{ margin: "60px auto", maxWidth: "800px", padding: "20px" }}
      >
        <h2>Services</h2>
        <ul>
          <li> Web Development with React</li>
          <li> TypeScript Consulting</li>
          <li> UI/UX Design</li>
          <li> Custom Web Apps</li>
        </ul>
      </section>

      {/* Gallery Section */}
      <section
        id="gallery"
        style={{ margin: "60px auto", maxWidth: "900px", padding: "20px" }}
      >
        <h2>Gallery</h2>
        <p>Here are some sample images:</p>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            gap: "20px",
            flexWrap: "wrap",
          }}
        >
          <img
            src="https://via.placeholder.com/250.png?text=Gallery+1"
            alt="Gallery 1"
            style={{ borderRadius: "8px" }}
          />
          <img
            src="public/image/541200658_1877356922846628_3967739818984924786_n.jpg"
            alt="Gallery 2"
            style={{ borderRadius: "8px" }}
          />
          <img
            src="https://via.placeholder.com/250.png?text=Gallery+3"
            alt="Gallery 3"
            style={{ borderRadius: "8px" }}
          />
        </div>
      </section>

      {/* Contact Section */}
      <section
        id="contact"
        style={{ margin: "60px auto", maxWidth: "800px", padding: "20px" }}
      >
        <h2>Contact</h2>
        <p>
           Email:{" "}
          <a href="mailto:example@email.com">example@email.com</a>
        </p>
        <p> Phone: +63 912 345 6789</p>
        <p> Location: Quezon City, Philippines</p>
      </section>

      <Footer />
    </div>
  );
}

export default App;
